// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.8.0;
import "./UserAccount.sol";
import "./AccountManager.sol";
import "./LeaseTransaction.sol";
import "./TransactionManager.sol";
import "./Lease.sol";
import "./Global.sol";

contract User {
    bytes32 private uid; //ID
    bytes32 private password; //
    AccountManager private ACM; //
    LeaseManager private LM; //
    TransactionManager private TM; //

    constructor(
        bytes32 _uid,
        bytes32 _password,
        Global g
    ) public {
        require(_uid.length != 0, "Need id");
        require(_password.length != 0, "Need password");

        address acm_addr = g.acm_addr(); //
        address lm_addr = g.lm_addr(); //
        address tm_addr = g.tm_addr(); //
        ACM = AccountManager(acm_addr);
        LM = LeaseManager(lm_addr);
        TM = TransactionManager(tm_addr);

        uid = _uid;
        password = _password;
        ACM.add_account(uid, new UserAccount(this)); //
        LM.add_user(uid); //
        TM.add_user(uid); //
    }

    function get_uid() public view returns (bytes32) {
        return uid;
    }

    function get_password() public view returns (bytes32) {
        return password;
    }

    function set_password(bytes32 _password) public {
        password = _password;
    }

    function get_account() public view returns (address) {
        return ACM.get_account(uid);
    }

    // 
    function create_lease(
        string memory house_name,
        string memory lon, //
        string memory lat, //
        bytes32 lid //key
    ) public {
        Lease l = new Lease(this, house_name, lon, lat);
        LM.add_user_lease(l, uid, lid);
    }

    // 
    function create_lease_txn(
        uint256 action,
        address action_user,
        address lease,
        uint256 money
    ) public {
        LeaseTransaction lt;
        uint256 txn_time = now;
        if (action == 1) {
            //
            lt = new LeaseTransaction(
                this,
                this,
                User(action_user),
                Lease(lease),
                money,
                txn_time,
                ACM
            );
        } else if (action == 2) {
            //
            lt = new LeaseTransaction(
                this,
                User(action_user),
                this,
                Lease(lease),
                money,
                txn_time,
                ACM
            );
        }
        TM.add_user_txn(lt, uid, txn_time); //
        TM.add_user_txn(lt, User(action_user).get_uid(), txn_time); //action user
    }
}
